CREATE TABLE Electric_Vehicle (
    VIN VARCHAR(50),
    County VARCHAR(50),
    City VARCHAR(50),
    State CHAR(2),
    Postal_Code INT,
    Model_Year INT,
    Make VARCHAR(50),
    Model VARCHAR(50),
    Electric_Vehicle_Type VARCHAR(100),
    CAFV_Eligibility VARCHAR(100),
    Electric_Range INT,
    Base_MSRP INT,
    Legislative_District INT,
    DOL_Vehicle_ID INT,
    Vehicle_Location VARCHAR(100),
    Electric_Utility VARCHAR(200),
    Census_Tract BIGINT
);






